import React from 'react';
import './home.css'
import dark1 from '../../../images/dark1.png'

const Home = () => {
    return (
        <section className='container'>
            <div className='home_h2'>
                <div className='dark_one'>
                    <img src={dark1} alt="" />
                </div>
                <div>
                    <h2>Мы создаем дизайн и веб-дизайн уже более 5 лет</h2>
                    <button>Связаться с нами</button>
                </div>

            </div>
        </section>
    );
};

export default Home;
